import { Row, Col } from 'antd';

import FavouritesCard from '../favCard/favCard'

/*
左侧导航的组件
 */
export default class CardContent extends Component{
    getCardNodes = (itemList)=>{
        return itemList.map(item => {
            if(newMenus.indexOf(item.key) !== -1){
                if(!item.children){
                    return(
                        <Menu.Item key={item.key} icon={<item.icon/>}>
                            <Link to={'/admin/'+item.key}>{item.title}</Link>
                        </Menu.Item>
                    )
                }else{
                    let cItem = item.children.find(cItem => cItem.key === this.props.path.split('/')[2])
                    if(cItem)this.openKey = item.key
                    return(
                        <SubMenu key={item.key} icon={<item.icon/>} title={item.title}>
                            {this.getMenuNodes(item.children, menus)}
                        </SubMenu>
                    )
                }
            }
            return null
        })
        // return(
        //     <Col>
        //         <FavouritesCard address='https://www.bilibili.com/'
        //         title='Card title1' description='This is the description'/>
        //     </Col>
