    }
    render(){
        const {itemList} = this.props
        const cardNodes = this.getCardNodes(itemList)
        return(
            <Row gutter={[16, 24]}>
                <Col>
                    <FavouritesCard address='https://www.bilibili.com/'
                    title='Card title1' description='This is the description'/>
                </Col>
                {/* {cardNodes} */}
            </Row>
        )
    }
}
